import {React, useState} from 'react'
import { Link } from "react-router-dom";
import './SignUp.css'
import signup from '../img/signup.jpg'
import googleIcon from '../img/google-icon.png'
import axios from 'axios';

function SignUp() {
	const [formData, setFormData] = useState({
		firstname: '',
		lastname: '',
		email: '',
		password: '',
		role: ''
	});

	const handleChange = (e) => {
		setFormData({ ...formData, [e.target.name]: e.target.value });
	};

	const handleSubmit = async (e) => {
		e.preventDefault();
		try {
		  const res = await axios.post('http://localhost:3000/auth/signup', formData); // Replace YOUR_BACKEND_PORT with your actual backend port
		  console.log(res.data); // Assuming your backend returns a message upon successful signup
		  // Handle success, maybe redirect to login page
		} catch (error) {
		  console.error(error.response.data); // Log error response from backend
		  // Handle error, maybe display error message to the user
		}
	  };


	  return (
		<div className="container">
		  <h1 className="heading">SignUp Form</h1>
		  <div className="form_container">
			<div className="left">
			  <img className="img" src={signup} alt="signup" />
			</div>
			<div className="right">
			  <h2 className="from_heading">SignUp</h2>
			  <input type="text" name="firstname" className="input" placeholder="First Name" onChange={handleChange} />
			  <input type="text" name="lastname" className="input" placeholder="Last Name" onChange={handleChange} />
			  <input type="text" name="email" className="input" placeholder="Email" onChange={handleChange} />
			  <input type="password" name="password" className="input" placeholder="Password" onChange={handleChange} />
			  <input type="text" name="role" className="input" placeholder="Role" onChange={handleChange} />
			  <Link><button className="button" onClick={handleSubmit}>SignUp</button></Link>
			  <p className="text">or</p>
			  <button className="google-button">
				<img src={googleIcon} alt="google icon" />
				<span>SignIn with Google</span>
			  </button>
			  <p className="text">
				Already Have Account ? <Link to="/login">Login</Link>
			  </p>
			</div>
		  </div>
		</div>
	  );
}

export default SignUp
